import Header from "./components/Header";
import "./App.css";
import MoneyBackground from "./components/MoneyBackground";
import ConverterWrapper from "./components/ConverterWrapper";
import Converter from "./components/Converter";

function App() {
  return (
    <>
      <Header />
      <MoneyBackground>
        <ConverterWrapper>
          <Converter/>
          <div id="app"></div>
        </ConverterWrapper>
      </MoneyBackground>
    </>
  );
}

export default App;
